import './Home.scss';


function Home(){
   var category = [
      {
          typefilm: "hd",
          nametypefilm:"PHIM HÀNH ĐỘNG"
      },
      {
          typefilm:"pl",
          nametypefilm:"PHIM PHIÊU LƯU"
      },
      {
          typefilm: "hh",
          nametypefilm: "PHIM HOẠT HÌNH"
      },
      {
          typefilm: "lm",
          nametypefilm: "PHIM LÃNG MẠN"
      },
      {
          typefilm: "kd",
          nametypefilm: "PHIM KINH DỊ"
      }
  ];
    return(
      <div>
        {
          category.map((data, index) => {
            return(
              <div>
                <h2>{data.nametypefilm}</h2>
                <div className = "row"></div>
              </div>
            )
          })
        }
      </div>
        
    )
}

export default Home;
